import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Start from './Start';
import MainComponent from './MainComponent';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/start" component={Start} />
        <Route path="/main" component={MainComponent} />
      </Switch>
    </Router>
  );
};

export default App;
